uint32_t NormLookup(UniChar c)
{
  uint32_t const hi = c >> 8;
  uint8_t pageIdx;
  if (hi < 0x100)
    pageIdx = kBmpPageDir[hi];
  else if (hi < 0x200)
    pageIdx = kPlane1PageDir[hi & 0xFF];
  else if (hi < 0x300)
    pageIdx = kPlane2PageDir[hi & 0xFF];
  else
    return kIdentity;
  if (pageIdx == kNoPage)
    return kIdentity;
  return kNormPages[pageIdx].e[c & 0xFF];
}

