void NormalizeInplace(UniString & s)
{
  // Fast path: if all characters are ASCII, nothing to normalize.
  if (std::none_of(s.begin(), s.end(), [](UniChar c) { return c >= 0xa0; }))
    return;

  UniString r;
  r.reserve(s.size());
  for (UniChar const c : s)
  {
    if (c < 0xa0) [[likely]]
      r.push_back(c);
    else
    {
      uint32_t const entry = NormLookup(c);
      if (entry == kIdentity)
        r.push_back(c);
      else if (entry != kStrip)
      {
        uint32_t const count = entry >> 24;
        uint32_t const payload = entry & 0x00FFFFFFu;
        if (count == 1) [[likely]]
          r.push_back(static_cast<UniChar>(payload));
        else
          for (uint32_t i = 0; i < count; ++i)
            r.push_back(kNormSymbols[payload + i]);
      }
    }
  }
  s.swap(r);
}

size_t NormalizeChar(UniChar c, UniChar * out)
{
  if (c < 0xa0) [[likely]]
  {
    out[0] = c;
    return 1;
  }
  uint32_t const entry = NormLookup(c);
  if (entry == kIdentity) [[likely]]
  {
    out[0] = c;
    return 1;
  }
  if (entry == kStrip)
    return 0;
  uint32_t const count = entry >> 24;
  uint32_t const payload = entry & 0x00FFFFFFu;
  if (count == 1) [[likely]]
  {
    out[0] = static_cast<UniChar>(payload);
    return 1;
  }
  for (uint32_t i = 0; i < count; ++i)
    out[i] = kNormSymbols[payload + i];
  return count;
}

